import React from 'react';
import './App.css';

class MomentCard extends React.Component {
    state = {
        active: false
    }

    render() {
        if (this.state.active) {
            return (
                <div></div>
            )
        }

        return (
            <div>
                <p>This is where my MomentCard is going to be</p>
            </div>
        )
    }
}

export default MomentCard;
